  null\n\t}],\n\t\"num_resources\": 13,\n\t\"tags\": [],\n\t\"title\": \"Marine organism
  concentrations, carbonate chemistry variables, and nutrient concentrations from
  Atlantis ecosystem model simulation output in the California Current from 2013-01-01
  to 2053-12-31 to understand vulnerability of California current food webs and economics
  to ocean acidification (NCEI Accession 0131198)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  16,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-10-11T21:06:43.666094\",\n\t\"name\": \"vulnerability-assessment-of-california-current-food-webs-and-economics-to-ocean-acidification-n\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This archival package contains the model
  output of a study to evaluate likely economic and ecological outcomes of ocean acidification
  in the California Current. Specifically, we have archived netcdf output files from
  simulations that accomplish the following:nna) Use a Regional Ocean Modeling System
  (ROMS) to predict present and future spatial projections of ocean acidification,
  as well as salinity, currents, and upwelling. ROMS was coupled to global circulation
  models (GFDL ESM2M) and IPCC CO2 scenarios.nb) Build on previous literature reviews
  and ongoing experiments to develop scenarios for the biological response of calcifying
  benethic organisms (e.g. mollusks, clams, brittle stars) to pH.nc) Use an Atlantis
  ecosystem model to project these direct impacts of acidification on lower trophic
  levels, the resulting food web-mediated response of harvested and protected stocks,
  and catches by US West Coast fisheries. Atlantis is driven by dynamic, spatially
  explicit fields from ROMS. See \"Technical Documentation\" here: http://www.nwfsc.noaa.gov/research/divisions/cb/ecosystem/marineecology/aem.cfmnnFour
  separate netcdf output files from Atlantis are provided here. They are 50 year projections
  of ecosystem model dynamics. These are 1) 2010sConditionsNopHResponse, which repeats
  or loops ocean conditions during the 2010s,with no effect of pH on organism biology
  2) 2060sConditionsNopHResponse, which repeats or loops ocean conditions during the
  2060s,with no effect of pH on organism biology 3) 2010sConditionsWithpHResponse,
  which repeats or loops ocean conditions during the 2010s, but with effect of pH
  on organism biology of calcifying benthic groups 4) 2060sConditionsWithpHResponse,
  which repeats or loops ocean conditions during the 2010s,with no effect of pH on
  organism biology.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
